import LoginPage from "./LoginPage"
import App from "./App";
localStorage.setItem("key",false)

export default function Authentication(){
    if(!localStorage.getItem("key"))
    {
        return(
            <>
            <LoginPage/>
            </>
        );
    }
    else{
        return(
            <>
            <App/>
            </>
        );
    }
}
